import React from 'react';
import { Link } from 'react-scroll';
import styled from 'styled-components';

const SideBlock = styled.div`
    width: 10%;
    position: fixed;
    right: 5rem;
    margin-top: 70px;
    
    
`

const Side = () => {
    return (
        <SideBlock>
            <Link>page1</Link>
        </SideBlock>
    )
}

export default Side;
